  false,\n\t\"url\": null,\n\t\"notes\": \"The AMAPPS survey primarily focuses on
  beaked whale species, with the following objectives: 1)  Develop a better understanding
  of beaked whale habitat use and site fidelity for abundance and monitoring of critical
  areas, 2)  Quantify efficacy of passive acoustic monitoring for detection and abundance
  of these species, through controlled methodological tests and in comparison to a
  bottom-mounted recorders (MARU), 3) Determine the distribution and relative abundance
  of plankton and prey species, 4) When possible, collect identification photographs
  and biopsy samples.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
